import styled from '@emotion/styled';

const ModalContent = (
  carClassId,
  image,
  carClassName,
  maker,
  carModel,
  fuel,
  gearbox,
  capacity,
  safetyOption,
  additionalOption,
) => {
  return <h1>carClassName : {carClassName}</h1>;
};

export default ModalContent;
